'use strict';
let SendSingleCommandWithoutResponse = require('./SendSingleCommandWithoutResponse.js');
let stdlib = require('@gehtsoft/LuaxStdlib-node').stdlib;
class SendStopOrderForOrderCommand extends SendSingleCommandWithoutResponse {
    stopOrderRequest;
    order;
    constructor() {
        super();
        this.commandName = "SendStopOrderForOrderCommand";
    }
    createTransportMessage() {
        return this.messageFactory.createStopOrderForOrderRequestMessage(this.tradingSession, this.stopOrderRequest, this.order, this.requestNumberGenerator, stdlib.nowutc());
    }
}
module.exports = SendStopOrderForOrderCommand
